import "./ExpenseItem.css";

const ExpenseItem = (props) => {
  return <div>
    <div className="itemDate">
      <br/>
      <br/>
    </div>
    <div className="itemTitle">{props.title}</div>
    <div className="itemAmount">{props.amount}</div>
  </div>;
};

export default ExpenseItem;
